import React from 'react';
import ReactDOM from 'react-dom';



const TableHeader = () => {
    return <h1>My Table</h1>;
};

const App = () => {
    return (<div>
        <TableHeader/>
        <Table/>
    </div>);
};

ReactDOM.render(<App/>, document.getElementById('root'));
